import React from "react";
import "./style.css";

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <h1>React Recipes</h1>
      <a target="_blank" rel="noopener noreferrer" href="./barrys3.png"></a>
    </div>
  );
}

export default Jumbotron;
